CREATE TABLE `banner` (
  `sid` bigint(20) NOT NULL AUTO_INCREMENT,
  `pic_url` varchar(255) DEFAULT NULL COMMENT 'banner图地址',
  `pic_sort` int(3) DEFAULT NULL COMMENT '排序',
