  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `dialog_logo_url` varchar(100) DEFAULT NULL COMMENT '弹窗logo',
  PRIMARY KEY (`sid`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8mb4;


